import styled from "styled-components";

export const Wrap = styled.div`
  color: white;
  font-size: 21px;
  padding-top: 25px;
  padding-bottom: 10px;
  background: #40933a;
  text-align: center;

  @media (max-width: 1045px) {
    padding-top: 75px;
  }
`;

export const Created = styled.div`
  color: white;
  font-size: 14px;
  padding-top: 10px;
  padding-bottom: 15px;
`;
